import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";
import './App.css';
import { Fragment } from "react";
import Home from "./pages/Home";
import Signin from "./pages/signin";
import Signup from "./pages/signup";

function App() {
  return (
    <Fragment>
      <div className="App">
        welcomto Gia Cat
      </div>
      <Router>
        <div>
          <hr />
          <Switch>
            <Route exact path="/">
              <Home />
            </Route>
            <Route path="/signin">
              <Signin />
            </Route>
            <Route path="/signup">
              <Signup />
            </Route>
          </Switch>
        </div>
      </Router>
    </Fragment>
  );
}

export default App;
